const GetQVSocketUrl = () => {
    let CDPObj = JSON.parse(localStorage.getItem("CDPObj"));

    if(CDPObj) {
        for(let k in CDPObj) {
            if(CDPObj[k].title == 'PCM - Work Center' && CDPObj[k].type == 'page') {
                return CDPObj[k].webSocketDebuggerUrl;
            }
        }
    }
    
}

const PingWC = () => {
    let wcsSpan = document.getElementById('wc-status');
    let wcUrl = GetQVSocketUrl();

    if(wcUrl === undefined) {
        wcsSpan.innerHTML = '<i style="color:tomato">No URL Data</i>';
    } else {
        const devtools = new WebSocket(wcUrl);
        
        devtools.onopen = (e) => {
        
            devtools.send(JSON.stringify({
            	id: 1,
            	method: 'Runtime.evaluate',
            	params: {
            		expression: `document.title;`
            	}
            }));
        }
        
        devtools.onerror = (e) => {
            wcsSpan.innerHTML = '<i style="color:tomato">Offline</i>';
            devtools.close();
            
        }
        
        devtools.onmessage = ({data}) => {
        	wcsSpan.innerHTML = '<i style="color:green">Online</i>';
            devtools.close();
        };
    }
}

async function LoadJs(url, tries=5, test = () => true) {
    let tryCount = 0;
    let result = false;

    while (tryCount < tries && result == false) {

        result = await new Promise((resolve,reject)=>{
            var script = document.createElement('script');
            script.setAttribute('type', 'text/javascript');
            script.setAttribute('async', false);

            script.onload = function() {
                if(test())
                    resolve(true);
                else
                    reject(false);
            }
            ;
            script.onerror = function() {
                this.remove();
                reject(false);
            }
            ;
            script.src = url;
            document.head.appendChild(script);
        }
        );

        tryCount++;
        console.log(`Script load attempt # ${tryCount} ${url}`);
    }

    console.log("Script load result: " + result);
}

async function GetTasks() {
    let tasks = await GetWorkCenterTasks();

    if(tasks?.Table == undefined)
        return tasks;

    if(!Array.isArray(tasks?.Table)) {
        tasks.Table = [tasks.Table];
    } 

    return tasks;
}

async function GetWorkCenterTasks() {
    
    let result = await new Promise((resolve, reject) => {
        
        let wcUrl = GetQVSocketUrl();

        if(wcUrl === undefined) {
            resolve([]);
        } else {
            const devtools = new WebSocket(wcUrl);
            
            devtools.onopen = (e) => {
            
                devtools.send(JSON.stringify({
                	id: 1,
                	method: 'Runtime.evaluate',
                	params: {
                		expression: `(async() => JSON.stringify(await GetWorkCenterTasks()))()`,
                        awaitPromise: true
                	}
                }));
            }
            
            devtools.onerror = (e) => {
                devtools.close();
                
            }
            
            devtools.onmessage = ({data}) => {
                devtools.close();
                
                let dataObj = JSON.parse(data);

                if(dataObj?.result?.result?.value == undefined) {
                    resolve([]);
                } else {
                    
                    let result = JSON.parse(dataObj?.result?.result?.value);
                    //console.log(dataObj?.result?.result?.value, typeof(result));
                    
                    if(typeof(result) == 'string') {
                        resolve({});
                    } else {
                        resolve(result);
                    }
                    
                }
                
                
            }
        }
    });

    return result;

}

